//import "./FormInput.css"



const FormInput = () => {

    const [name, setName] = useState("")

    const submitHandler = (event) => {
        event.preventDefault();
    }


    return (
        <form onSubmit={submitHandler}>
            <label>
                Nome
                <input type="text"></input>
            </label>
            <button type="submit">Enviar</button>
        </form>
    );
}

export default FormInput;
